import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import Grid from "@material-ui/core/Grid";

import Item from "./Item.js";

class TodoList extends React.Component {
  constructor() {
    super();
    this.state = {
      list: [
        {
          id: 1,
          task: "Go home",
          completed: false
        },
        {
          id: 2,
          task:
            "Take test Note that the development build is not optimized. Note that the development build is not optimized.",
          completed: false
        },
        {
          id: 3,
          task: "Perform",
          completed: false
        },
        {
          id: 1,
          task: "Go home",
          completed: false
        },
        {
          id: 2,
          task: "Take test",
          completed: false
        },
        {
          id: 3,
          task: "Perform",
          completed: false
        }
      ],
      task: {
        id: 0,
        task: "",
        completed: false
      }
    };
  }

  render() {
    const listItems = this.state.list.map(item => (
      <div>
        <Item item={item} />
      </div>
    ));
    return (
      <div className="listMainContainer">
        <div className="listContainer">{listItems}</div>
        <Grid container>
          <Grid item md={10} sm={6}></Grid>
          <Grid item md={2} sm={6}>
            <Fab color="primary" aria-label="add" className="AddIcon">
              <AddIcon />
            </Fab>
          </Grid>
        </Grid>
      </div>
    );
  }
}
export default TodoList;
